import React from 'react'
import { Card, Image, Icon } from 'semantic-ui-react'

class MovieCard extends React.Component {
    render() {
        return (
            <React.Fragment>
                {console.log(this.props)}
                <Card>
                    <Image src={this.props.movie.poster_path} wrapped ui={false} />
                    <Card.Content>
                        <Card.Header>{this.props.movie.original_title}</Card.Header>
                        <Card.Meta>
                            <span className='date'>{this.props.movie.release_date}</span>
                        </Card.Meta>
                        <Card.Description>
                            {this.props.movie.overview}
                        </Card.Description>
                    </Card.Content>
                    <Card.Content extra>
                        <a>
                        <Icon name='user' />
                        Rating: {this.props.movie.vote_average}
                        </a>
                    </Card.Content>
                </Card>

            </React.Fragment>
        )
    }
}

export default MovieCard
